void read(Tokeniser t, CharacterReader r) {
switch (r.current()) {
t.advanceTransition(EndTagOpen);
break;
if (r.matchesLetter()) {
t.createTagPending(true);
t.transition(TagName);
}

public static Document parse(String html, String baseUri) {
TreeBuilder treeBuilder = new HtmlTreeBuilder();
return treeBuilder.parse(html, baseUri, ParseErrorList.noTracking());
}

public void put(Attribute attribute) {
Validate.notNull(attribute);
if (attributes == null)
attributes = new LinkedHashMap<String, Attribute>(2);
attributes.put(attribute.getKey(), attribute);
}

protected Node(String baseUri, Attributes attributes) {
Validate.notNull(baseUri);
Validate.notNull(attributes);
childNodes = new ArrayList<Node>(4);
this.baseUri = baseUri.trim();
this.attributes = attributes;
}

private Selector(String query, Element root) {
Validate.notNull(query);
query = query.trim();
Validate.notEmpty(query);
Validate.notNull(root);
this.evaluator = QueryParser.parse(query);
this.root = root;
}

abstract Token reset();
if (sb != null) {
sb.delete(0, sb.length());
}

final void newAttribute() {
if (attributes == null)
if (pendingAttributeName != null) {
if (!hasPendingAttributeValue)
attribute = new Attribute(pendingAttributeName, pendingAttributeValue.toString());
attributes.put(attribute);
pendingAttributeName = null;
reset(pendingAttributeValue);
}

public Element(Tag tag, String baseUri) {
this(tag, baseUri, new Attributes());
}
